import React from 'react';
import ReactPlayer from 'react-player';

const VideoPlayer = () => {
  return (
    <div>
      <ReactPlayer
        url='https://youtu.be/8g9ccCkT-u0?si=7XmR1a100M8HtCMD'
        controls={true}
      />
    </div>
  );
};

export default VideoPlayer;
